webpackJsonp([0xba29743fa095],{1318:function(e,t){e.exports={data:{site:{siteMetadata:{title:"Psyked.co.uk",author:"James Ford"}},markdownRemark:{id:"/Users/James/Repositories/portfolio-2018/src/posts/one-week-get-to-grips-with-adobe-air/index.md absPath of file >>> MarkdownRemark",html:'<p><em>"James!"</em> they say, <em>"you\'ve been dying to play with Flex and Air. Make us an application to accompany our E-Newsletter!"</em> How could I refuse?</p>\n<p><em>"You have until friday."</em></p>\n<p>So that\'s what I\'ve been doing.</p>\n<p><img src="http://uploads.psyked.co.uk/2007/08/flexair.jpg" alt="flexair.jpg"></p>\n<p>I have unfortunately, no previous experience with Flex, Air or even ActionScript 3, so this is proving to be interesting. Marketing has settled on producing an RSS reader - stay tuned and I\'ll let you know how things turn out in couple o\' days.</p>',frontmatter:{title:"One week get to grips with Adobe AIR...",date:"August 01, 2007",tags:["flex","actionscript","air"],url:null}}},pathContext:{}}}});
